INSERT INTO `faqs` (`id`, `title`, `details`, `status`) VALUES
(1, 'What are the different payment methods on JBS Devices?', '<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Stripe, We offer the best payment merchants to secure our clients details.<o:p></o:p></p>', 1),
(3, 'Can I sell on JBS Devices?', '<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Any brand interested in selling their products on JBS\r\nDevices can contact our team and by emailing us. We go through a strict\r\nchecking procedure to make sure that the products are genuine and authentic only\r\nafter going through a series of checks the products end up on our websites.&nbsp;<o:p></o:p></p>', 1),
(5, 'Are all the brands on JBS Devices verified?', '<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">All devices sold on JBS Devices are verified and\r\noriginal. JBS Devices does not deal with any kind of counterfeit product. It is\r\na part of our selling policy that the products sold on JBS Devices are branded\r\nand verified by our experts.&nbsp;<o:p></o:p></p>', 0),
(6, 'Is it safe to use JBS Devices?', '<div style=\"text-align: center;\"><div style=\"text-align: left;\"><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">JBS devices are 100% original and safe to use. All the\r\nproducts on our website are assessed by the team in every aspect to make sure\r\nthat only the most reliable and durable products are offered to our customers.&nbsp;<o:p></o:p></p></div></div>', 0),
(7, 'How to use JBS Devices?', '<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Every device sold on our website comes with a user\r\nmanual that is simple and easy to read. By reading the manual thoroughly our\r\ncustomers can understand the product and use it properly.&nbsp;<o:p></o:p></p>', 0),
(8, 'How soon my order will be processed?', '<div><span style=\"color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">Order placed during the business hours usually process within 1-2 working days, but it also depends on the type of shipping you choose during checkout. All the refurbished items got tested include a full cleaning and cosmetic evaluation by our certified technicians before shipping to the customer.</span><br></div>', 0),
(9, 'Do you ship outside USA?', '<div><span style=\"color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">Yes, we ship internationally including Asia, Europe, South America and Australia. You can&nbsp;</span><a href=\"https://jbsdevices.com/contact\" target=\"_blank\" style=\"color: rgb(44, 45, 51); background-color: rgb(255, 255, 255); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">contact us</a><span style=\"color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">&nbsp;if you need more details.</span><br></div>', 0),
(10, 'Where is your warehouse located?', '<div><span style=\"color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">We have multiple warehouses all over the world including USA, UK, Canada, and some parts of Europe. We ship inventory from the closest location.</span><br></div>', 0),
(11, 'Do you accept bulk orders?', '<div><span style=\"color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">Yes, We Accept PO\'s from SMEs, Fortune 500 Companies, Government Agencies, Universities, and Schools.</span><br></div>', 0),
(12, 'What are refurbished items?', '<div><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">Refurbished means that the item was sent back to the original manufacturer, and it has been rechecked or reassembled and to provide cost effective solution and to provide end of life products.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">Reason to buy refurbished IT devices:</p><ul style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 3em; padding: 0px; list-style-position: initial; list-style-image: initial; color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\"><li>Better quality</li><li>Lower costs</li><li>Extend the Life of your Current Technology</li><li>A More Reliable Warranty</li><li>A Greener Solution</li><li>Save IT budget</li></ul></div>', 0),
(13, 'The exact model I need is not listed, different image or specs are different, what should I do now?', '<p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">We have an inventory of 500,000+ SKUs and it\'s not possible to keep all the data up to date on our website, you can&nbsp;<a href=\"https://jbsdevices.com/contact\" target=\"_blank\" style=\"color: rgb(44, 45, 51); background-color: rgb(255, 255, 255);\">contact us</a>&nbsp;with all the details and we will try to correct information or procure required part for you.<br></p>', 0),
(14, 'Can I make a change to my order after it’s been submitted?', '<p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; color: rgb(67, 69, 75); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 16px;\">Yes, but only if the order has not been processed already (check your order status). To change your order, you must get in touch with our Customer Service Department via chat or call&nbsp;<a href=\"mailto:+1%20469-459-9688\" style=\"color: rgb(44, 45, 51); background-color: rgb(255, 255, 255);\">+1 469-459-9688</a><br></p>', 0);
