(1, '16730225221673022418fotor_2023-1-6_21_25_35.png', '1672937108DealsOnDriveslogo.webp', 'Deals On Drives', '30 N Gould ST Sheridan, WY 82801, United States', 'sales@dealsondrives.com', 'orders@dealsondrives.com', '+1 847-677-2771', 'Mon - Fri / 9:00AM - 6:00PM (PST)', 'smtp', '+1 8476772771', 'Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae', 'WE SHIP WORLDWIDE', 'COPYRIGHT © 2023. All Rights Reserved By <a href=\"#\" title=\"JBS Devices\" target=\"\">D</a>eals On Drives', '#e8582b', '162032476504de2e31234507.564a1d23645bf.gif', 'dealsloader.png', 1, '<!--Start of Tawk.to Script-->\r\n<script type=\"text/javascript\">\r\nvar Tawk_API=Tawk_API||{}, Tawk_LoadStart=new Date();\r\n(function(){\r\nvar s1=document.createElement(\"script\"),s0=document.getElementsByTagName(\"script\")[0];\r\ns1.async=true;\r\ns1.src=\'https://embed.tawk.to/6079c907067c2605c0c32791/1f3drii05\';\r\ns1.charset=\'UTF-8\';\r\ns1.setAttribute(\'crossorigin\',\'*\');\r\ns0.parentNode.insertBefore(s1,s0);\r\n})();\r\n</script>\r\n<!--End of Tawk.to Script-->', 0, 0, 'AIzaSyB1GpE4qeoJ__70UZxvX9CTMUTZRZNHcu8', 0, NULL, 1, 1, 1, 1, 1, 'pk_test_sxEor5bQbFmAQof1uHvOgeRU', 'sk_test_wrTjK9ZrWPTzVBeDYhl79OO7', 0, 5, 5, 0, 5, 'server.e-bizness.com', '465', 'orders@dealsondrives.com', 'utg.4&GH-dq0', 'orders@dealsondrives.com', 'Orders', 1, 1, 1, 'Successfully Added To Cart', 'Out Of Stock', 'Add To Wishlist', 'Already Added To Wishlist', 'Successfully Removed From The Wishlist', 'Successfully Added To Compare', 'Already Added To Compare', 'Successfully Removed From The Compare', 'Successfully Changed The Color', 'Coupon Found', 'No Coupon Found', 'Coupon Already Applied', 'THANK YOU FOR YOUR PURCHASE.', 'We\'ll email you an order confirmation with details and tracking info.', 0, 8, '15587771131554048228onepiece.jpeg', 'Already Added To Cart', 0, 5, 1, 0, 0, 1, 'Pay with cash upon delivery.', 'Pay via your PayPal account.', 'Pay via your Credit Card.', '#ffffff', '#33425a', '#02020c', 1, '#ff5500', '#02020c', 0, 0, 'test_172371aa837ae5cad6047dc3052', 'test_4ac5a785e25fc596b67dbc5c267', 'Pay via your Instamojo account.', 0, 1, 0, 'pk_test_162a56d42131cbb01932ed0d2c48f9cb99d8e8e2', 'junnuns@gmail.com', 'Pay via your Paystack account.', 100, 0, '1566878455404.png', 0, 'NEWSLETTER', 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Expedita porro ipsa nulla, alias, ab minus.', '1584934329adv-banner.jpg', '1672936977DealsOnDriveslogo.webp', '1615158947profileimagelogo.png', '#666666', 1, 1, 1, 'sb-nwqag2786401@business.example.com', '1673022418fotor_2023-1-6_21_25_35.png', 'ssl', 'tkogux49985047638244', 'LhNGUUKE9xCQ9xY8', 'WEBSTAGING', 'Retail', 0, 'Pay via your Paytm account.', 'sandbox', 0, 'test_5HcWVs9qc5pzy36H9Tu9mwAyats33J', 'Pay with Molly Payment.', 0, 'rzp_test_xDH74d48cwl8DF', 'cr0H1BiQ20hVzhpHfHuNbGri', 'Pay via your Razorpay account.', 0, 0, '<div style=\"text-align: center;\"><font size=\"5\"><br></font></div><h1 style=\"text-align: center;\"><font size=\"6\">WEBSITE IS UNDER MAINTENANCE</font></h1>', '<div class=\"data item content\" aria-labelledby=\"tab-label-Warranty\" id=\"Warranty\" data-role=\"content\" role=\"tabpanel\" aria-hidden=\"false\" style=\"display: block;\">\r\n                            <div><font size=\"3\"><font size=\"5\">Warranty may vary according to item condition</font>.<br><br><b>Our usual warranty is:</b><br><br></font><ul><li><font size=\"3\">Refurbished 30 days</font></li><li><font size=\"3\">New Open Box 90 days</font></li><li><font size=\"3\">New Factory Sealed 1 year or standard manufacturer warranty</font></li></ul></div><div><font size=\"3\">Our items undergo a series of rigorous tests! All used or refurbished products are examined by our fulfillment team to ensure that any cosmetic issues will not affect the performance of your order. Our warehouse technicians also perform diagnostic tests to make sure you get exactly what you ordered and that it functions properly. If you have any issues with your purchase, contact us and we\'ll do our best to resolve them.<br></font></div><div><font size=\"3\"><br></font></div><div><font size=\"3\">Our goal at Deals On Drives is to provide customer service that is better than any other and to do this we must offer what you need. Our staff will help you with warranty questions if needed or assist you with information on purchasing aftermarket accessories, so please give us a call at </font><font size=\"3\"><a href=\"tel:+1 469-459-9688\">+</a><font color=\"#0056b3\">1 847-677-2771</font>&nbsp;or email us </font><a href=\"email:support@jbsdevices.com\" title=\"\" target=\"\"><font size=\"3\">support@dealsondrives.com</font></a></div><div><br></div><div><font size=\"3\">Item Condition: Refurbished</font><br></div><div><br></div><div><font color=\"#3333CC\"><a href=\"https://jbsdevices.com/terms-and-conditions\" title=\"\" target=\"\"><font size=\"3\">Read More...</font></a></font><br></div><div><font size=\"3\"><br></font></div>\r\n                        </div>');
