: inherit; font-family: \" proxima=\"\" nova\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" color:=\"\" rgb(45,=\"\" 81,=\"\" 174);=\"\" text-transform:=\"\" uppercase;\"=\"\">ABOUT OUR SITE</h4><h2><p class=\"policyDetails\" style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 12px; line-height: 1.8; font-family: \" proxima=\"\" nova\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" color:=\"\" rgb(64,=\"\" 69,=\"\" 83);\"=\"\">The Site is an e-commerce platform that allows enterprise users to offer and sell products, and individuals and enterprise entities to buy products.</p><p class=\"policyDetails\" style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 12px; line-height: 1.8; font-family: \" proxima=\"\" nova\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" color:=\"\" rgb(64,=\"\" 69,=\"\" 83);\"=\"\">We reserve the right to introduce new Services and update or withdraw any of the Services, in our sole discretion, and we will not be liable to you for exercising this discretion.</p><ol class=\"orderedList\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 12px; line-height: inherit; font-family: \" proxima=\"\" nova\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" list-style:=\"\" none;=\"\" counter-reset:=\"\" item=\"\" 0;=\"\" color:=\"\" rgb(64,=\"\" 69,=\"\" 83);\"=\"\"><li class=\"subHeadingList\" style=\"margin: 25px 0px 0px; padding: 0px 15px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"subHeading\" style=\"margin: 25px 0px 15px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(45, 81, 174); text-transform: uppercase;\">ELIGIBILITY AND REGISTRATION REQUIREMENTS</span><ol class=\"orderedList\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none; counter-reset: item 0;\"><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\">You are eligible to register as a buyer or seller and benefit from the Services if you meet the following eligibility criteria:</span><ol class=\"policyListWrapper\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none;\"><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">for buyers:<ol class=\"policyListWrapper\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none;\"><li class=\"policyListRoman\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit;