bought through a seller that is not us, the terms of the respective seller’s warranty will apply.</p></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><p class=\"blockText\" style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Excluding Apple products (Accessories warranty: 1 year), other electronics device accessories are subject to six (6) months warranty starting from the product purchase date.</p></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><p class=\"blockText\" style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Warranty repairs will be carried out by authorized service centers. In instances where products are bought through a seller that is not us, the terms of the respective seller’s warranty will apply.</p></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><p class=\"blockText\" style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">The original invoice is required to verify the serial number and validate the warranty period to benefit from warranty services.</p></li><li class=\"policyDetailsLis