.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">you do not, within a reasonable time of us asking for it, provide us with information that is necessary for us to provide the products; or</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">you do not, within a reasonable time, allow us to deliver the products to you or collect them from us; or</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">you attempt to bulk or multi-order purchase in accordance with clause 2.8, below.</li></ol></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Bulk/Multiple Purchasing.</b>&nbsp;We reserve the right to reject any orders, at our sole discretion, where we detect bulk purchasing or multiple units of similar products being purchased.</span></li></ol></li><li class=\"subHeadingList\" style=\"margin: 25px 0px 0px; padding: 0px 15px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"subHeading\" style=\"margin: 25px 0px 15px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(45, 81, 174); text-transform: uppercase;\">DELIVERY OF YOUR ORDER</span><ol class=\"orderedList\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none; counter-reset: item 0;\"><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Delivery Costs.</b>&nbsp;The costs of delivery will be as displayed to you on our Site.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Delivery Date.</b>&nbsp;This information will be displayed to you on our Site.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Delivery Delays:</b></span><ol class=\"policyListWrapper\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none;\"><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">if our supply of the product is delayed by an event outside of our control, then we will contact you as soon as possible to let you know and we will take steps to minimise the effect of the delay;</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">if no one is available at your address to take delivery and the products cannot be posted through your letterbox, we will notify you of how to rearrange delivery or collect the product;</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-varian