-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Non-returnable Products.</b>&nbsp;You do not have a right to return, replace or exchange products in respect of:</span><ol class=\"policyListWrapper\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none;\"><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">products that are classified as hazardous materials or use flammable liquids or gases;</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">products that have been used or damaged by you or are not in the same condition as you received them;</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">any consumable product which has been used or installed;</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">products with tampered or missing serial numbers; or</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">products that fall under specific categories, including food, beverages, household goods, digital books, swimwear, hosiery, underwear, socks, health, contact lenses, hygiene related and personal care products and certain baby products (e.g. tethers, diapers, hygiene tissues, feeding related products) music, video and video games.</li></ol></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Contacting Us (arrange a Return).</b>&nbsp;You may contact us through email, social media or live chat on the Site, or by calling our call centre on 800-3-8888 (UAE) or 800-11-60-210 (KSA).</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Your Refund:</b></span><ol class=\"policyListWrapper\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none;\"><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">For delivered products, we will refund to you the product amount (excluding the amount paid for the original shipping fees) in full plus the cost of return:<ol class=\"policyListWrapper\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none;\"><li class=\"policyListRoman\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-roman; list-style-position: initial;\">if the products are faulty or not as described on our Site; or</li><li class=\"policyListRoman\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-roman; list-style-position: initial;\">if you reason for return is due to an error on our side, such as an error in pricing or description, a delay in delivery etc.</li></ol><p class=\"policyDetails\" style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 12px; line-height: 1.8; font-family: inherit; vertical-align: baseline; color: rgb(64, 69, 83);\">In all other circumstances, we will refund the product amount (excluding the amount paid for the original shipping fees) and you may pay the costs of return shipping.</p><p class=\"policyDetails\" style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 12px; line-height: 1.8; font-family: inherit; vertical-align: baseline; color: rgb(64, 69, 83);\">For products not delivered, you will receive a full refund if you cancel the order under clause 2.6;</p></li></ol></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Refund Procedure.</b>&nbsp;We will issue a refund to you depending on the method you used for payment, as follows:</span><ol class=\"policyListWrapper\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none;\"><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">if you paid by cash on delivery, we will issue a refund to your wallet; or</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">if you paid by credit/debit card, you can choose to have a refund by credit/debit card or to your wallet.</li></ol></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Refund Timescale.</b>&nbsp;Your refund will be initiated once your product is received back in our customer fulfilment center and inspected by our team, and the final refund will be received by you as follows:</span><ol class=\"policyListWrapper\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: none;\"><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline; list-style-type: lower-alpha; list-style-position: initial;\">if the refund is to your credit/debit card, within thirty (30) days from the day on which we receive the product back in our customer fulfilment center;</li><li class=\"policyList\" style=\"margin: 10px 15px 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inheri