line-height: inherit; font-family: inherit; vertical-align: baseline;\">Warranty.</b>&nbsp;A twelve (12) month warranty will be provided for certain purchased products against defects that occur after purchase and a twenty-four (24) month warranty for all Electronic (defined herein) products that are sold to buyers in the Kingdom of Saudi Arabia. A three (3) month warranty (maximum) will apply to selected refurbished products. The warranty is not applicable to cases other than defects in material, design and workmanship. Warranty obligations are limited to repair of defective product or replacement of the defective part, or replacement or refund according to market price of the product itself (such decision at the product seller’s discretion). Not all products are covered by the warranty, always check the product listing to know if it includes warranty benefits.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Authorised Service Centres.</b>&nbsp;On selected products and in instances where we are considered the seller, warranty repairs will be carried out by authorized service centres. In instances where products are bought through a seller that is not us, the terms of the respective seller’s warranty will apply. Please refer to our&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; f