dding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Further Assurances.</b>&nbsp;The parties will do and execute or arrange for the doing and executing of each necessary act, document and anything reasonably within its power to implement and give effect to these Terms of Sale to its full extent, including, without limitation, assisting each other in complying with applicable law.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Assignment.</b>&nbsp;These Terms of Sale will be binding upon and ensure to the benefit of the parties and their respective successors and permitted assigns. You agree that you will not assign or transfer these Terms of Sale or any of your rights or obligations under these Terms of Sale, whether directly or indirectly, without first obtaining our prior written consent, such consent not to be unreasonably withheld.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Entire Agreement.</b>&nbsp;These Terms of Sale and the documents referred to or incorporated herein by reference contain the entire agreement between the parties with respect to the subject matter and supersede all prior agreements, negotiations and representations, written or oral, relating to its subject matter. Except as provided in these Terms of Sale and the documents referred to or incorporated into these Terms of Sale by reference, there are no conditions, representations, warranties, undertakings or agreements between the parties whether direct, indirect, collateral, express or implied.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Amendment.</b>&nbsp;These Terms of Sale cannot be modified, varied, amended or supplemented in any way by you. We reserve the right to modify, vary, amend or supplement these Terms of Sale at any time and from time to time. We will post the current version of these Terms of Sale on the Site and each such change will be effective upon posting on the Site or upon the date designated by us as the “effective date” (if any). Your continued use of the Site and our services following any such change constitutes your agreement to be bound by and its acceptance of these Terms of Sale as so modified.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Severability.</b>&nbsp;If any provision of these Terms of Sale is determined by any court of competent jurisdiction to be invalid, illegal or unenforceable, that provision will be severed from these Terms of Sale and the remaining provisions will continue in full force and effect so long as the economic or legal substance of the transactions contemplated hereby is not affected in any manner materially adverse to either of the parties.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Force Majeure.</b>&nbsp;Neither party will be liable for any loss or damage or for any delay or failure in performance due to acts beyond the control of such party whether or not such acts could reasonably be anticipated (including acts of God, legislative, judicial or regulatory acts of any provincial or the federal government, court or regulatory authority, acts of any of our subcontractors or any third party providers of goods or services to us, labour disruptions, blackouts, embargoes).</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">No Waiver.</b>&nbsp;Any waiver by us of any of the provisions of these Terms of Sale will not constitute a waiver of any other provision (whether similar or not), nor will any such waiver constitute a continuing waiver of that particular provision, unless expressly provided by us in writing.</span></li><li class=\"policyDetailsList\" style=\"margin: 10px 0px 0px; padding: 0px 25px; border: 0px; font: inherit; vertical-align: baseline; display: block; position: relative;\"><span class=\"policyDetails\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.8; font-family: inherit; vertical-align: baseline;\"><b style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Survival.</b>&nbsp;All provisions that either expressly or by their nature survive, will survive suspension or termination of your membership of the Site.</span></li></ol></li></ol>', NULL, NULL, 0, 0);
INSERT INTO `pages` (`id`, `title`, `slug`, `details`, `meta_tag`, `meta_description`, `header`, `footer`) VALUES
(6, 'Consumer Rights', 'consumer-rights', '<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Data for Other Resources: </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">The details obtained from consumers is for the main\r\npurpose of proceeding with the orders placed and is only used to give our\r\ncustomers the best possible service. Details could be obtained for other\r\nservices from consumers, we will apply it to our consumer log to resolve any\r\npotential customer service issues. You should refer to the sample of the\r\ninformation collection process listed at the end of this policy to learn more. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>JBS devises cookies</b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Cookies are a type of discriminating icons consisting\r\nof letters and numbers that are read from your internet browser by your hard\r\ndrive machine. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Our website is customized to provide our consumers with\r\na great experience. Therefore, based on the information we gather through the\r\ncookies, our webpages are updated. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">They can also provide the browser style information to\r\nshow the characteristics and quantities of an object. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">You can opt to deactivate the browser\'s cookies.\r\nAllowing cookies, though, will help you make the most of the most unique\r\nJBSDevices.com programs, so we suggest that you set up an open status for this\r\napplication. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Data from other sources </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Below are some details of the information we get from\r\nother resources, like the information we get from our clients or third parties\r\nabout the dispatch and address. It allows our documents to be corrected which\r\nmakes it easier for us to contact you and deliver the next order in due time. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Details about the account. </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Information for\r\npurchase or return</b>. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Keyword searches and outcomes generated by the\r\noperation of associated firms; information obtained from cooperative companies\r\non web surfing. Search results and ties, including a non-free archive of\r\nsearches. JBSDevices.com can quickly access the documents containing the\r\ncurrent order information, identifiable personal information (including name,\r\nemail address, password, directory inquiries, etc.), payment settings\r\n(including credit card details), and so on. You can contact us by email or\r\nphone if you have any more questions or queries. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Return Policy </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">We seek to make the experience of our customers during\r\nthe purchase and distribution as seamless as possible. After all attempts and\r\nvigilance, it is not assured, though, that nothing can go wrong and the\r\nconsumer may decide to refund the product. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">In this case, by subscribing to the terms and\r\nconditions below, please create an RMA (Return Merchandise Authorization)\r\nsubmission. For both our company partners and customers, this page discusses\r\nour policies in all those situations. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>See below for the words mentioned. </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">You must mention any inconsistencies between the order\r\nput and the goods obtained within 2 days of delivery of the order. Customers\r\nwho are not consumers are included among our \"Business Customers\"\r\nWhereas, our \"Consumer\" includes persons who do not behave for the\r\ninterests of their organization or career. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Order Cancelation </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If a client or company account wants to cancel an\r\norder, we will not charge them anything extra until the order dispatching\r\nprocess until receiving an email with the order reference number or PO number.\r\nFailure to email before the order is dispatched would impose a 25 percent\r\nre-stocking fee. If the package has already been dispatched, we recommend that\r\nclients or company accounts not open the shipment upon its delivery. Over the\r\nnext 14 days of the delivery of the package, consumers may then arrange to\r\nreturn the shipment. Using the original outer packaging, you may guarantee the\r\nitem is properly re-packaged, or a 25 percent re-stocking fee can be paid. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Within 14 days of the customers\' signed goods, we\r\ninsist that the goods stay unused so that we can accept them in a resalable\r\nstate, including all accessories, packaging, etc. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">You must arrange protection against the goods when they\r\nare in transit to limit responsibility for damaged goods. Please also remember\r\nthat you are expected to plan and pay for the return of the shipment. Our\r\nshipments that are non-returnable and non-cancellable contain orders that are\r\ndelivered directly from suppliers. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Conditions for Non-Faulty returns </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If we consent, at our exclusive discretion, to allow\r\nthe return of unwanted items for credit, the merchandise must be returned\r\nwithin fourteen days of delivery with our prior written arrangement, unopened,\r\nwith the seals of the suppliers intact, and in a resalable condition. Whereas,\r\nall non-faulty returns are responsible, depending on the case, for a 25 percent\r\nto 50 percent restocking charge, unless improperly given by JBS Devices. In the\r\ncondition, if the buyer fails to return wrongly supplied products in their\r\noriginal state, including the tools, manuals, applications, and warranties of\r\nthe goods, a 25 percent re-stocking fee may be charged. Customers are required\r\nto repack the items the same way they were shipped. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Procedure of RMA </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Please send an RMA request by submitting the following\r\nterms and conditions for the return of all products to JBS Devices, independent\r\nof the reason for the return: Goods must remain undamaged and must be returned,\r\nwith all accessories, manuals, applications, and warranties originally in the\r\nbox, in their original state. Upon obtaining your RMA number, you must safely\r\nrepackage the items, preferably inside the original outer box, in the same\r\ncondition as they were shipped to you. If the original box is labeled or\r\ndestroyed in some manner, a restocking charge of 25 percent might be available.\r\nRefrain from writing about the outer package/box specifically. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Ensure that the RMA number written on the outer\r\npackage/box is easily visible; failure to do so would result in the package\r\nbeing refused. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Write the full address of JBS Devices specifically on\r\nthe outer package/box using a sticker. Once the items have been obtained and\r\nchecked, within 10 days of receipt of the defective item, we will refund the\r\nrepair item to you. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Damaged goods complain: </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If the goods are defective upon arrival, please be sure\r\nto sign the goods with the courier as faulty and immediately contact us via\r\nemail or mobile. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">In every such scenario, within two working days of\r\narrival, we recommend that you report the defective goods to us. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Hardware replacement may be invalidated for the\r\nfollowing reasons, including, but not limited to: Against the data given on the\r\nRMA form, the good is not defective. If the object has been compromised or\r\ntempered. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">When the wrong software is used, JBS Devices holds the\r\nright to charge a 25 percent restocking fee if the original box has been\r\ndestroyed or if the parts and accessories of the package are missing. Please\r\nreach us by phone or email to learn more about our return policies and for any\r\nqueries. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Conditions for Shipping </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>FedEx tracking number is not running, what\'s the\r\nproblem? </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">One of your items may have been removed from the box by\r\nFedEx, or they may not have delivered all of your items. In such a scenario,\r\nyou might be asked to wait a bit longer for the things you ordered to be\r\nshipped. However, if your order is unfortunately not received, you can contact\r\nour customer service or our shipping department for an update on your package.\r\nIf you get a faulty shipment, you may call the carrier directly. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>What do I do if I am unable to receive my order\r\nwithin the period selected by UPS/FedEx? </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">We recommend that you review the UPS/FedEx Details.\r\nMessage and learn whether a delivery re-attempt is allowed. On the Details\r\nNote, you will even leave a message for the courier to tell him how the delivery\r\ncan be delivered; leave it at your door or send it to a new venue. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">We recommend that you visit the UPS/FedEx page and type\r\nyour Details Request number on the website so that you can change the time of\r\ndelivery or return your order to the shipper. Is my order possible for me to\r\npick it up? <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>JBS Devices provides you with the ease of picking up\r\nyour order. </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">To do this, simply pick the shipping form \"I want\r\nto use my shipper\" in your shopping cart and enter \"will call\"\r\nin all the blank information before pressing update. Once you do this, as you\r\nusually will, resume the checkout process and wait for us to contact you.\r\nWhenever your order is ready to be picked up, we will call. Please be aware\r\nthat we will contact you after approving your order, so we recommend that you\r\nnot visit the office until you have been informed. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Are we shipping internationally? </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">We are proud to pursue a very stringent\r\ncustomer-centered approach, and we also ensure that consumers benefit from our\r\ngoods and services provided worldwide. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">We move globally, but regretfully remind you that in\r\nyour home country, we do not pay tariffs and taxes, and ask you to pay domestic\r\nshipping charges. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Do we ship to addresses that are APO or FPO? </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">You should be assured that we send to APO addresses and\r\nFPO addresses. Orders sent to APO and FPO addresses, however, can only be sent\r\nby the US postal service, with little discretion about the timing of delivery.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>If so, how do I contact FedEx? </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">FedEx can be reached on the official website: <u><span style=\"color:#0000EE\">www.FedEx.com</span></u>,\r\nor by calling their toll-free number at 1-800-463-33399. (1-800-GO-FEDEX).<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Can JBS Devices account for the risk of returning\r\nproducts that are faulty or destroyed upon delivery for shipping? </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">It is with sadness to state that we will not pay\r\ndelivery charges for returned goods that are faulty, but with mutually agreed\r\nnegotiations, we will satisfy you. If you agree to pay for the refund charges\r\nfor the faulty piece, we will happily repair and send a new item to you free of\r\ncharge. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Standard Free Delivery </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If a non-defective item eligible for free regular\r\nshipping is returned for a refund, we will subtract the shipping costs from the\r\nrefund number. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If you return a free regular shipping item because it\r\nis faulty, we will repair the item and provide you with a free one-way ground\r\nshipping service. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">However, if the order does not wait longer, you will\r\nhave to pay for the extra cost. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">In the event of failure to locate a substitute for an\r\nobject, please be assured that we will refund the full value of your orders. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Shipping Services </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">JBS Devices makes use of the delivery systems of UPS,\r\nFedEx, and USPS in all regions of the US to transport goods directly from its\r\nwarehouses. Our primary distribution partners are all the transportation\r\nproviders listed. Many orders are delivered by JBS Devices within 24 hours of\r\norder placing. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Our list of shipping services with their\r\ncorresponding cut-off times is listed below: </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Ground</b>: The transit time in the US ONLY is from\r\n3-7 business days, the cut-off time is 1 pm Central Time. Ground orders can be\r\ndelivered either by UPS or USPS, depending on the venue. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>UPS 3 Day</b>: UPS orders are in transit for 3\r\nbusiness days, but ONLY in the US. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>UPS 3 Days\' time cut-off1pm FedEx 2 Day: </b>For\r\norders made ONLY in the US, FedEx takes 2 business days in transit and the\r\ncut-off time is 1 PM Central Time. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Standard Overnight</b>: For orders made ONLY in the\r\nUS, the standard delivery service takes around 1 business day in transit. 1 PM\r\nCentral Time is the cut-off time. We can deliver the order via UPS Red Saver or\r\nFedEx Normal Overnight service, depending on the venue. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Priority Overnight:</b> 1 business day transfer time\r\nfor orders placed in the US ONLY, with a 1 PM Central Time cut-off time. We\r\nwill offer UPS Red or FedEx P1 Overnight service, depending on the venue,\r\nguaranteeing delivery by 10:30 AM on the same day. International Shipping: 1 PM\r\nCentral Time is the cut-off time for all international orders. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Using the FedEx International Economy process, we ship\r\ninternational orders. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>APO/FPO:</b> JBS Devices uses USPS Registered Mail\r\nto ship all APO/FPO orders. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Puerto Rico/Canada:</b> All orders delivered to\r\nPuerto Rico/Canada are shipped by the delivery system of FedEx\'s International\r\nEconomy, although their cut-off time is 1 PM Central Time. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Saturday Shipping: </b>It operates in all US states\r\nand on all orders made on Friday. The cut-off is midnight Central Time and\r\norders can be delivered by the Saturday Delivery system of UPS or FedEx. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>What is the cut-off time?</b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Cut-off time mentions the time after order placing your\r\norder will be processed. If your order is received before 1 PM Central Time, it\r\nwill be handled on the same day, although it will be processed on the next business\r\nday if your order is placed after 1 PM Central Time. if you want your order to\r\nbe delivered before or after the above cut-off dates, please contact our Sales\r\nDepartment and we will look into your case. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Delays in Shipment </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">On weekends and holidays, our delivery system does not\r\nprocess any requests. Because each order goes to processing time, if possible,\r\nwe ask you to be careful. We want you to note that assured delivery facilities,\r\nnot counting the time it takes to process the shipment, are only guaranteed for\r\nthe transit time. It is humanly difficult to ensure that all orders will be\r\ndelivered on the same day, while most orders are shipped on the same day. For\r\norders made from Hawaii, Alaska, Puerto Rico, Canada, and other foreign\r\nlocations with JBS Devices, we cannot guarantee fixed shipping dates. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>If an ordered object is missing from my box, what do\r\nI do? </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Please make sure that you can all the shipments for\r\nwhich you have obtained the tracking numbers. If you do not locate the goods,\r\nplease email our customer service or our Shipping Support Team at\r\nshipping@JBSDevices.com or call us at 00-0000000. We are at 00-0000000. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Conditions and Terms of Use </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">The following are the guidelines relating to the proper\r\nuse of the JBSDevices.com website, the goods, and services provided by us are\r\nnot limited to, our product directory, lists, but also include external links\r\nto every other website. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">You agree to abide by the above Terms and Conditions of\r\nUse of the Site (TCUS) while accessing our website, including, but not limited\r\nto, our privacy policy, other instructions that we may check and amend over\r\ntime, collected and written for your reference herein, and you also agree to\r\nfollow our relevant JBS Devices rules and regulations. The JBS Devices (the\r\n\"Company\") reserves the right, if necessary, to adjust its TCUS every\r\nso often. To read about the latest improvements and improvements made on the\r\nwebsite, users are responsible for reviewing our account from time to time.\r\nYour existence and use of the website would be viewed as approval of some\r\nimprovement following the improvements in JBS Devices TCUS (s). Users under the\r\nage of 13 years of age are explicitly barred from accessing our website and\r\nfrom publishing personal and identifying material. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">The aim of our website is not to be used by people aged\r\n13 or under. The JBS Devices (the \"Company\") reserves the right, if\r\nnecessary, to adjust its TCUS every so often. To read about the latest\r\nimprovements made on the website, users are responsible for reviewing our\r\naccount from time to time. Your existence and use of the website would be\r\nviewed as approval of some improvement following the improvements in JBS\r\nDevices TCUS (s). <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Users under the age of 13 years of age are explicitly\r\nbarred from accessing our website and from publishing personal and identifying\r\nmaterial. The aim of our website is not to be used by people aged 13 or under. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Authorization and Usage Privileges </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">JBS Devices (the \"Company\") offers users an\r\ninclusive right and permission to view and use the website for any real,\r\ncommercial or non-commercial purchase of products for use or r