n any way invasive or\r\ndamaging. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Contents and Stock Listings </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">JBS Devices strives and works to provide comprehensive\r\ndetails about all of the items offered; the specifications, names, photographs\r\nshown, costs, links, references to compatibility, and other related information\r\non the website. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">However, as regards human potential, it cannot promise\r\nor warrant that, irrespective of its source, the material and relevant material\r\ncontributed to on the website would be fully correct, credible, modified, or\r\nerror-free. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">The material provided on the website by JBS Devices is\r\nfor information purposes only and does not produce any sponsorship of any\r\nproduct, service, reseller, manufacturer, or other related entities offered. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">In case of any typographical, technological, or other\r\nmiscalculation, a product or service sold by a company has incorrect details or\r\nerroneous pricing, the company shall, with its sole caution, reserve the right\r\nto deny or refuse orders made for the product or service in question and thus\r\nimmediately check and change the product or service records<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Links to Sites and Businesses </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Our website provides links (hyperlinks) to websites of\r\nother vendors, details blog pages of third parties, analysis sites, related\r\nfirms, and affiliate sites, and other outlets to help users with their buying\r\nchoices. Each connection provided by the Organization is for information\r\npurposes only and the assistance of customers. The Corporation does not equate\r\nthese ties in any manner with any recognition of the content of the third-party\r\npages or their market practices. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Order Acknowledgement </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If you buy a product from the JBS Devices product page,\r\nyou get a website order acknowledgment that makes and accepts your order.\r\nHowever, it is not a contract and does not produce approval of the order, and\r\nacts merely as a record of the order, describing the purchase and its pricing.\r\nJBS Devices will decide whether or not to satisfy your order after you put an\r\norder. For any because which may not be disclosed, JBS Devices retain the right\r\nto cancel or restrict your order.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">JBS Devices does not recognize any duties or\r\nliabilities for the assessment of such material or other enterprises. Reading\r\nand reviewing their TCUS and privacy policy policies are your responsibility. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">JBS Devices does not have any influence or jurisdiction\r\nover the entities affiliated with its website or any of its corporate processes\r\nand procedures. In no way does the Company monitor or take responsibility for\r\nthe quality, legality, and protection of the goods and services provided on the\r\nhyperlinked website or company, nor does the Company take responsibility for or\r\ncontrol business transactions carried out on the linked companies or websites. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Delivery Disputes</b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">In the event of any dispute or wrongdoing between a\r\ncustomer and any company site redirected to JBS Devices.com to the maximum\r\ndegree allowed by the relevant statute, the user shall keep JBS Devices\r\ninnocent and discharge its founders, branches, partners or any other affiliated\r\ngroup, its respective officials, administrators, staff, agents or legal\r\nrepresentatives, arising out of any or any of the roles and statements or\r\ndamages arising out of or in some manner connected with some such wrongdoing or\r\ndispute, whether identified or unknown, alleged or unsuspected. In the order\r\nplacing process, clients often reserve the right to convey their delivery\r\norders to the carrier service. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">However, JBS Devices will select a shipping method that\r\nbetter suits the distribution of the customer\'s ordered product where there are\r\nno directions given by the customer. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">In no circumstances will the Company be responsible for\r\nany delay or harm sustained during the shipping process of the freight. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Also, if the shipping is postponed due to the customer,\r\nthe Company shall, in all cases, store the goods purchased at the customer\'s\r\ncost and cost. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Damage during shipping</b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Chance of any injury or failure to the product in the\r\ncase of the FOB shipping process, any harm, loss, or damage to the product will\r\nbe carried on to the consumer, his agent, or the freight/carrier service\r\nsolely. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Order cancellation</b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Order Termination Orders accepted by JBS Devices will\r\nNOT be subject to a customer\'s modification or revocation without the express\r\napproval of JBS Devices or its approved members. Every order canceled,\r\nsubstituted, or updated would have a nominal processing charge of $25 or 15\r\npercent of the order value. If you wish to cancel or change your order, you\r\nwill contact our customer service.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">There will be no order termination emails approved. In\r\nthe event of a product\'s unavailability or backorder status, JBS Devices can\r\nreject or cancel, at its own will, an order. We apologize to you for any\r\ninconvenience of that kind. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">You are expected to become conscious, verify, or\r\nacknowledge that any of the things in our listings may not be in stock.\r\nTherefore, please check the stock specifics before making an order. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If the company no longer offers/stocks a good that it\r\nhas received for substitution from a client, or if the service is out of stock\r\non occasion, it may be referred to the Department of RMA. The consumer would\r\nhave two alternatives in such a situation: JBS Devices will give you a similar\r\nrepair or replacement piece. JBS Devices issues a rebate that evaluates the\r\nactual market value of the commodity purchased. In every such scenario, the\r\npresent price of the retail product does not surpass the initial invoiced price\r\nof the good. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Jurisdiction authority </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">In the event of any judicial proceeding to deduce or\r\nenforce the terms of this Arrangement being taken, the jurisdiction and\r\nlocation shall be within the Local or Superior courts of the State of Circuit\r\nCourt of the United States, or elsewhere, according to the joint agreement of\r\nthe parties involved. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Control &amp; Central Law </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Any questions respecting the form and development of\r\nthis Arrangement, the rights and obligations of the parties, as provided for in\r\nthe terms of the documents, shall be decided and determined only in compliance\r\nwith the relevant legislation of the State of the United States of America. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Prosecutor\'s Cost </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Where any civil act, mediation, prosecutions are\r\ncarried out in compliance with the clarifications or enforcements of this\r\nArrangement, or in respect to the interests of a Defendant, due to any\r\nperceived violation of the Agreement, wrongdoing or disagreement, effective\r\nmisconduct, or the principal Party, fair attorney\'s fees or other associated\r\ncosts shall be recovered.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Dropship Requests for Product by Customers</b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If a customer asks our company to sell or send their\r\ngoods to a third party, the customer and the third party\'s final user would\r\nboth have to be bound by the terms and conditions of this arrangement. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Conflicting words</b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Any terms and conditions related to and/or presented in\r\nthe orders of the consumer that may interfere with JBS Devices TCUS would not\r\nbe available without JBS Devices\' written approval. Both instructions approved\r\nby JBS Devices shall, however, be subject to TCUS. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Purchase Money Security Interest</b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If the customer effectively completes, executes, and\r\napproves an order, the customer gives JBS Devices the right to \'continued\r\nbuying money protection interest\' as security on all due or timely payments in\r\nall payable sums under any purchased order from the customer. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">It hereby grants access to all merchandise or other\r\nproceeds of which the consumer has any right, title, or interest. Upon its\r\ntimely request, customers shall enter JBS Devices to complete financial\r\nstatements, any changes, or continuity statements and pay the same filing costs\r\nat any time when JBS Devices estimates are required; customers shall complete\r\nand send to JBS Devices all records, equipment and do as JBS Devices may\r\nrequest to fully enforce this Protection Inter Drives <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">If under the protection arrangement given, the\r\ncustomer/buyer is in default, JBS Devices retains the right to seek relief\r\navailable under the statute. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Cash Back guarantee </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Please read our return policy carefully, so you can\r\nswap or return the product ordered from JBS Devices in case of any\r\ninconvenience. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Professional Assistance from Free CCIE: </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">We also set up a free Cisco Specialist Consulting\r\nProgram for professional learning and technological assistance for customers.\r\nBy phone, email, or the live chat option, you can contact us. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Payment &amp; Shipping Secure: </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Our customers trust us and, above all, we respect this\r\ntrust. Our suppliers ship our goods on schedule and with proper protection,\r\nensuring that a safe payment system is in operation. Our checked authorization\r\nincludes VeriSign Safe, MacAfee Security. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Copyrights </b><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">JBS Devices does not reflect, in any way, known or\r\nunknown, any intellectual property rights that it may or may not have on the\r\ncatalog of goods on its websites. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>100 percent Price Match Guarantee: Warranty Info <o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">At JBS Devices, we aim to provide you with the lowest\r\navailable commodity costs and provide a 100% guarantee that our prices will\r\nnever reach the price of the rival. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Free Technical\r\nSupport <o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">We provide free training to our clients by hiring cisco\r\nexpert. You can get the training by contacting our customer service helpline. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>100% Quality\r\nAssurance:</b> <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">We emphasize product quality for improved consumer\r\nservice, and thus, before each shipping, a full check and balance is carried\r\nout for all goods. We still make sure that all of our products are 100%\r\nauthentic and original. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Secure shipment\r\nand payment <o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:\r\nminor-latin\">Our clients trust us and at JBS Devices we value this trust above\r\nall. Our manufacturers ship the products on time and with complete safety,\r\nensuring there is a secure payment method in place. Our verified authorization\r\nare: VeriSign Secured, MacAfee Security.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Return Material\r\nAuthorization (RMA) Process: <o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">In the case of any returns, after agreeing on the terms\r\nand conditions are given, an RMA request should be raised: <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">1. Regardless of the justification for return, it is\r\nobligatory on all returns of JBS Devices objects. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">2. Products with all the accessories, manuals,\r\napplications, and warranty statements should be returned. The original\r\npackaging does not result in any harm. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">3. You will have to repack items exactly as they have\r\nbeen shipped to you upon getting your RMA number, maybe in the original outer\r\nbox/package. If the original packaging is destroyed, a re-stocking fee of 25\r\npercent may be paid. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">4. Do not write explicitly on the initial box to\r\nprevent return rejection. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">5. Mention the address of JBS Devices on the outer box\r\ncorrectly and simply by using a sticker. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">6. When our supply chain department has acquired and\r\nchecked the shipment, you can collect the exchanged package within 10 days of\r\ndelivery of the defective item. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">7. Please notice that we must be told within two days\r\nof the arrival of the items in case of any inconsistencies between your PO and\r\nthe products purchased. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\"><b>Faulty products\r\nunder warranty <o:p></o:p></b></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in\">Immediately after you encounter a defect in your\r\npurchased piece, please submit an RMA order. The terms and conditions to be\r\nagreed upon before the RMA submission are as follows: <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n0in;margin-left:.5in;margin-bottom:.0001pt;text-indent:-10.2pt;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->Quote the damaged item\'s order number, purchase\r\ndate, and serial number. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-10.2pt;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->After verifying the warranty of the damaged\r\ndevice, one of our engineers will attempt to fix your issue over the phone or\r\nthrough remote access. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-10.2pt;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->An RMA number will be given if the problem\r\ncontinues, and you will need to follow our regular RMA protocol.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-10.2pt;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->We will test it and correct the issue after the\r\nobject has been returned. When the object will not be restored, we can send a\r\nreplacement. <o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:12.0pt;\r\nmargin-left:.5in;text-indent:-10.2pt;mso-list:l1 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->Hardware that has been replaced can be new or\r\nsimilar to new and have equal or equivalent requirements.<o:p></o:p></p><p class=\"ccInfo\" style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 12px; line-height: 1.8; font-family: \" proxima=\"\" nova\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" color:=\"\" rgb(64,=\"\" 69,=\"\" 83);\"=\"\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<img src=\"https://a.nooncdn.com/s/misc/2017/consumer_right_logo_1024.png\" class=\"ccImg\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; display: block; height: 200px;\"></p>', NULL, NULL, 0, 0);
INSERT INTO `pages` (`id`, `title`, `slug`, `details`, `meta_tag`, `meta_description`, `header`, `footer`) VALUES
(7, 'About US', 'about-us', '<p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\"><font size=\"5\">About us&nbsp;</font></p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\">We not only fulfill all of your IT needs but also exceed them.&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\"><font size=\"5\">Our Journey&nbsp;</font></p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\"><b>JBS Devices</b> originally started as <b>JBS Solutions</b> in the late 90s catering to the progressing technological needs of that era. Our founder at <b>Jaffer Business System Private Limited</b> worked hard to come up with solutions for technical problems people faced while going through different business ventures. We have come a long way from working with small entrepreneurs to working for big firms all over the world. Our dedication and work ethic is what helped us to grow into this new pursuit.&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\"><font size=\"5\">Progress&nbsp;</font></p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\">JBS Devices was recently introduced to address the industry\'s need for innovative hardware and software products and services, delivering a range of technology needs. We are optimistic that we will dominate the IT e-commerce market with years of experience in procuring &amp; delivering the best computer hardware products and services. JBS Devices is driven by a mission to turn ourselves into a full-fledged reseller and product integrator of IT hardware &amp; applications, offering specific services in upgrading computer systems and revamping complete IT infrastructure. Through our tech-savvy consultants and professionals, we are committed to moving along with the support of our clients. Our ambition is to provide promising, unmatched goods and services to the IT e-commerce industry. We host a vast inventory of computer hardware items from all flagship brands of routers, servers, desktops, laptops, and notebooks of all brands and models, including computer memory, hard drives, CPUs, and other accessories. Over the years, we were successful in completing hundreds of thousands of upgrades in a variety of industries as we work offline. JBS Devices is driven only by its consumers, so the use of our customer-centered approach leads us to endless performance. To support our clients, we work on designing systems that are purely standardized and actively pursued. Our clientele encompasses marketing, educational, legal, manufacturing, and healthcare, security, financial services, government, and more organizations. JBS Devices seeks to refine the customer-centered approach into a futuristic and creative IT e-commerce market with an agile presence.&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\">Our efforts are aimed at achieving customer loyalty and confidence, establishing valuable relationships with a multinational clientele, and satisfying the needs of our clients by offering excellent services, assistance, and after-sales services. We regularly follow up with customers and ask for their input to enhance the experience, from the process of order choice, selection, and order processing.&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\"><font size=\"5\">Why do our customers choose us over and over again?</font></p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\">With tech specialists and researchers, JBS Devices distinguishes itself by focusing its emphasis and regards fairly on the welfare of its personnel, vendors, associates, and consumers. JBS Devices brings value and loyalty to its global consumers by providing goods and services that help achieve maximum productivity from new machines and ensure optimal functioning of existing machines over the last few years. We know that consumers not only buy goods but create relationships with us, so we ensure that they buy with complete self-assurance and trust from us.&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\">In a way that represents consumer empathy and responsiveness, we design our method and practice in a way making us respond to our consumers and encourage them to make smarter purchasing choices. Our tech specialists provide consumers with the information that helps them with their needs, making sure it is all nuanced and important. JBS Devices delivers affordable pricing from world-class suppliers and producers, conveniently and strategically, without reducing the functionality or efficiency of any item.&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\">It is our standard to ensure that before being delivered, all the items sold on our website, JBS Devices.com, are carefully and descriptively numbered, classified, and thoroughly reviewed.&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\"><font size=\"5\">Our clients</font></p><p class=\"MsoNormal\" style=\"margin-bottom:12.0pt\">We represent government clientele, including local, state, and federal offices; US postal services; US Worldwide Embassies; the Department of Defense, including the Armed Forces. Educational institutions, universities, hospitals, and VA medical centers are all part of our list. Microsoft, Google, Intel, Hewlett-Packard, IBM, and several Fortune 500 firms include our corporate clientele and others with which we collaborate. Looking to sell via JBS Devices? If you are a retailer, dealer, or producer and are looking through our sales team to partner and market your goods, you can phone or email us, we are at support@jbsdevices.com, or call us at <a href=\"tel:+1 469-459-9688\">+1 469-459-9688</a>. To offer on your blogs, storefronts, and partnering pages, you can also connect with us.</p>\r\n\r\n<a href=\"https://www.tawk.to/?pid=6br70gk\" target=\"_blank\"><img src=\"https://partners.tawk.to/badges/partner-08.png\" width=\"150\"></a>', NULL, NULL, 0, 1),
(8, 'Products Return and Exchange Policy', 'products-return-and-exchange-policy', '<div><font size=\"5\">Software &amp; Hardware products.</font></div><div><br></div><div>Items featured on our website are futuristic and advanced. Our high-tech computers are made by well-known manufacturers, including HP, Cisco, Micron, Kingston, WD, IBM/Lenovo, FUJITSU, TOSHIBA, DELL, APPLE, and SAMSUNG, based on INTEL and AMD processors.</div><div>Over the years, we have a variety of hardware devices available, including all server brands and models, printers, computers, desktops, video graphics cards, motherboards, routers, and so on. Old-generation machines are also supported to help clients find the best upgrades and provide them with just what they are looking for. It is usually a given that updating or adding additional memory increases most equipment\'s functionality.&nbsp;</div><div>We know that updating the processor of a device with a quicker and improved solution increases performance and expands a product\'s useful life. Old-generation improvements are therefore made available to new hardware systems for cost-efficiency and durability,&nbsp;</div><div>To help clients identify and pick the best items for their computer devices, we simplify our operation. Our \"Ultimate Configurator\" function allows you to check for the form of a device (e.g., Notebook Memory) or suppliers (e.g., Dell, Compaq, HP, IBM) and then lead you to the correct product line or model number. This function can be used to scan within seconds for the best combination. We successfully and carefully initiate almost 98 percent of our memory orders on the same day because of our advanced feature, \"The Ultimate Configurator,\" and our streamlined supply chain management system. The client base of JBS Devices is wide.&nbsp;</div><div><br></div><div><b>ADDRESS&nbsp;</b></div><div><b><br></b></div><div><b>CONTACT US&nbsp;</b></div><div><b><br></b></div><div><b>PURCHASE&nbsp;</b></div><div><b><br></b></div><div><b>SALE&nbsp;</b></div><div><b><br></b></div><div><b>RMA RETURN AND EXCHANGE</b></div><div><b><br></b></div><div><b>TECHNICAL SUPPORT&nbsp;</b></div><div><b><br></b></div><div><b>SUPPLIER AND MANUFACTURER&nbsp;</b></div><div><b><br></b></div><div><b>International orders</b></div><div><b><br></b></div><div><font size=\"5\">JBS Devices Delivers all over the Globe&nbsp;</font></div><div><font size=\"5\"><br></font></div><div>We deliver worldwide. Shipping is not limited to any country and our services are internationally accessible. International shipping rates can vary, so you may pick \'international shipping\' as your shipment with your preferred goods at the checkout to determine the shipping rates.&nbsp;</div><div><br></div><div>Then, before processing, you will be able to see the relevant shipping cost of your order. You can also select the highest delivery cost in the order form. For items heavier than 5 lbs., after receiving your order, we will send a quote via email. Our shipping rate estimator would not be of benefit in those situations. No processing fee is charged on any overseas orders. The consumer must pay any customs fees imposed by the customs office&nbsp;</div><div><br></div><div>After labeling your order as merchandise, we list the actual value and contents of the box, e.g., \'Hard Drive - Computer Hardware\'. If you wish to label your order as presents, we will only omit the receipt from the package at the time of order placing upon your request, but we cannot mark the order as a gift.&nbsp;</div><div><br></div><div>If you are a consistent client, our order facility method would help you without any complications. We appreciate you placing your orders with us and all other foreign clients, but it is sadly not within our power to validate international credit cards due to the limitations imposed by your home country. Therefore, we are required to reserve the right to cap, postpone, or maybe cancel credit card payments for an order paid and delivered to international addresses. We also receive a variety of fraudulent credit card complaints.&nbsp;</div><div><br></div><div>We suggest you pay by PayPal or Wire Transfer for us to validate credit card payments.&nbsp;</div><div>We recommend that overseas credit card purchasers use PayPal to put their orders. You can easily pay at paypal@JBSDevices.com. If you do not have a PayPal account, you are encouraged to use Visa, MasterCard, or American Express to pay. Please also be aware that payment verification can take longer than 7 business days.&nbsp;</div><div><br></div><div>If you have an official email address for the company\'s domain, the authentication of your payment will become smoother. Depending on the card issuer and/or country, checking a few Amex and Visa/MasterCard accounts is difficult. Therefore, we can ask you to email or fax identity evidence after verification options have been exhausted. Otherwise, by Wire Transfer TT, you may be asked to pay.&nbsp;</div><div><br></div><div><font size=\"5\">Rules on Privacy&nbsp;</font></div><div><font size=\"5\"><br></font></div><div>It is not convenient for anyone to share personal information, and we appreciate that the client is still worried about the use and distribution of it. For both JBS Devices and our clients, we have developed a privacy policy that will work for our customers as well as our website. Our site is controlled by JBS Devices. If you visit our website (<a href=\"https://www.jbsdevices.com/\" title=\"JBS Devices\" target=\"_blank\">www.JBSDevices.com</a>), we will assume that you have consented to this Privacy Policy being adopted.&nbsp;</div><div><br></div><div><font size=\"5\">Includes information automatically&nbsp;</font></div><div><font size=\"5\"><br></font></div><div>We obtain and compile the provided data for our records at any point in time when you connect with us. Like several other pages, we use \"cookies\". When your Internet browser visits JBSDevices.com, for ease of order details and positioning, it collects some details (please refer to the sample of Information Collecting Process stated at the end of this policy). Many sites provide you the technologies to help you access the website anonymously, but we are worried that we will not be able to give you personalized support on our website due to your undisclosed ID in such a situation.&nbsp;</div><div><br></div><div><font size=\"5\">Correspondence e-mail&nbsp;</font></div><div><br></div><div>For us to make the e-mail process more effective, when you open an email from us, we will receive an email confirming you have read the delivered email. To prevent spam mail, we will also perform a contrast between our client list and other businesses, but only if your device allows such a feature.&nbsp;</div><div><br></div><div><font size=\"5\">Data for Other Resources:&nbsp;</font></div><div><br></div><div>The details obtained from consumers is for the main purpose of proceeding with the orders placed and is only used to give our customers the best possible service. Details could be obtained for other services from consumers, we will apply it to our consumer log to resolve any potential customer service issues. You should refer to the sample of the information collection process listed at the end of this policy to learn more.&nbsp;</div><div><br></div><div><font size=\"5\">JBS devises cookies</font></div><div><br></div><div>Cookies are a type of discriminating icons consisting of letters and numbers that are read from your internet browser by your hard drive machine.&nbsp;</div><div><br></div><div>Our website is customized to provide our consumers with a great experience. Therefore, based on the information we gather through the cookies, our webpages are updated.&nbsp;</div><div><br></div><div>They can also provide the browser style information to show the characteristics and quantities of an object.&nbsp;</div><div><br></div><div>You can opt to deactivate the browser\'s cookies. Allowing cookies, though, will help you make the most of the most unique JBSDevices.com programs, so we suggest that you set up an open status for this application.&nbsp;</div><div><br></div><div><font size=\"5\">Data from other sources&nbsp;</font></div><div><br></div><div>Below are some details of the information we get from other resources, like the information we get from our clients or third parties about the dispatch and address. It allows our documents to be corrected which makes it easier for us to contact you and deliver the next order in due time.&nbsp;</div><div><br></div><div><font size=\"5\">Details about the account.&nbsp;</font></div><div><br></div><div><font size=\"5\">Information for purchase or return.&nbsp;</font></div><div><br></div><div>Keyword searches and outcomes generated by the operation of associated firms; information obtained from cooperative companies on web surfing. Search results and ties, including a non-free archive of searches. JBSDevices.com can quickly access the documents containing the current order information, identifiable personal information (including name, email address, password, directory inquiries, etc.), payment settings (including credit card details), and so on. You can contact us by email or phone if you have any more questions or queries.&nbsp;</div><div><br></div><div><font size=\"5\">Return Policy&nbsp;</font></div><div><br></div><div>We seek to make the experience of our customers during the purchase and distribution as seamless as possible. After all attempts and vigilance, it is not assured, though, that nothing can go wrong and the consumer may decide to refund the product.&nbsp;</div><div><br></div><div>In this case, by subscribing to the terms and conditions below, please create an RMA (Return Merchandise Authorization) submission. For both our company partners and customers, this page discusses our policies in all those situations.&nbsp;</div><div><br></div><div><font size=\"5\">See below for the words mentioned.&nbsp;</font></div><div><br></div><div>You must mention any inconsistencies between the order put and the goods obtained within 2 days of delivery of the order. Customers who are not consumers are included among our \"Business Customers\" Whereas, our \"Consumer\" includes persons who do not behave for the interests of their organization or career.&nbsp;</div><div><br></div><div><font size=\"5\">Order Cancelation&nbsp;</font></div><div><br></div><div>If a client or company account wants to cancel an order, we will not charge them anything extra until the order dispatching process until receiving an email with the order reference number or PO number. Failure to email before the order is dispatched would impose a 25 percent re-stocking fee. If the package has already been dispatched, we recommend that clients or company accounts not open the shipment upon its delivery. Over the next 14 days of the delivery of the package, consumers may then arrange to return the shipment. Using the original outer packaging, you may guarantee the item is properly re-packaged, or a 25 percent re-stocking fee can be paid.&nbsp;</div><div><br></div><div>Within 14 days of the customers\' signed goods, we insist that the goods stay unused so that we can accept them in a resalable state, including all accessories, packaging, etc.&nbsp;</div><div><br></div><div>You must arrange protection against the goods when they are in transit to limit responsibility for damaged goods. Please also remember that you are expected to plan and pay for the return of the shipment. Our shipments that are non-returnable and non-cancellable contain orders that are delivered directly from suppliers.&nbsp;</div><div><br></div><div><font size=\"5\">Conditions for Non-Faulty returns&nbsp;</font></div><div><font size=\"5\"><br></font></div><div>If we consent, at our exclusive discretion, to allow the return of unwanted items for credit, the merchandise must be returned within fourteen days of delivery with our prior written arrangement, unopened, with the seals of the suppliers intact, and in a resalable condition. Whereas, all non-faulty returns are responsible, depending on the case, for a 25 percent to 50 percent restocking charge, unless improperly given by JBS Devices. In the condition, if the buyer fails to return wrongly supplied products in their original state, including the tools, manuals, applications, and warranties of the goods, a 25 percent re-stocking fee may be charged. Customers are required to repack the items the same way they were shipped.&nbsp;</div><div><br></div><div><font size=\"5\">Procedure of RMA</font>&nbsp;</div><div><br></div><div>Please send an RMA request by submitting the following terms and conditions for the return of all products to JBS Devices, independent of the reason for the return: Goods must remain undamaged and must be returned, with all accessories, manuals, applications, and warranties originally in the box, in their original state. Upon obtaining your RMA number, you must safely repackage the items, preferably inside the original outer box, in the same condition as they were shipped to you. If the original box is labeled or destroyed in some manner, a restocking charge of 25 percent might be available. Refrain from writing about the outer package/box specifically.&nbsp;</div><div><br></div><div>Ensure that the RMA number written on the outer package/box is easily visible; failure to do so would result in the package being refused.&nbsp;</div><div><br></div><div>Write the full address of JBS Devices specifically on the outer package/box using a sticker. Once the items have been obtained and checked, within 10 days of receipt of the defective item, we will refund the repair item to you.&nbsp;</div><div><br></div><div><font size=\"5\">Damaged goods complain:&nbsp;</font></div><div><br></div><div>If the goods are defective upon arrival, please be sure to sign the goods with the courier as faulty and immediately contact us via email or mobile.&nbsp;</div><div><br></div><div>In every such scenario, within two working days of arrival, we recommend that you report the defective goods to us.&nbsp;</div><div><br></div><div>Hardware replacement may be invalidated for the following reasons, including, but not limited to: Against the data given on the RMA form, the good is not defective. If the object has been compromised or tempered.&nbsp;</div><div><br></div><div>When the wrong software is used, JBS Devices holds the right to charge a 25 percent restocking fee if the original box has been destroyed or if the parts and accessories of the package are missing. Please reach us by phone or email to learn more about our return policies and for any queries.&nbsp;</div><div><br></div><div><font size=\"5\">Conditions for Shipping&nbsp;</font></div><div><br></div><div><b>FedEx tracking number is not running, what\'s the problem?&nbsp;</b></div><div><b><br></b></div><div>One of your items may have been removed from the box by FedEx, or they may not have delivered all of your items. In such a scenario, you might be asked to wait a bit longer for the things you ordered to be shipped. However, if your order is unfortunately not received, you can contact our customer service or our shipping department for an update on your package. If you get a faulty shipment, you may call the carrier directly.&nbsp;</div><div><br></div><div><b>What do I do if I am unable to receive my order within the period selected by UPS/FedEx?&nbsp;</b></div><div><b><br></b></div><div>We recommend that you review the UPS/FedEx Details. Message and learn whether a delivery re-attempt is allowed. On the Details Note, you will even leave a message for the courier to tell him how the delivery can be delivered; leave it at your door or send it to a new venue.&nbsp;</div><div><br></div><div>We recommend that you visit the UPS/FedEx page and type your Details Request number on the website so that you can change the time of delivery or return your order to the shipper. Is my order possible for me to pick it up?&nbsp;</div><div><br></div><div><b>JBS Devices provides you with the ease of picking up your order.&nbsp;</b></div><div><br></div><div>To do this, simply pick the shipping form \"I want to use my shipper\" in your shopping cart and enter \"will call\" in all the blank information before pressing update. Once you do this, as you usually will, resume the checkout process and wait for us to contact you. Whenever your order is ready to be picked up, we will call. Please be aware that we will contact you after approving your order, so we recommend that you not visit the office until you have been informed.&nbsp;</div><div><br></div><div><b>Are we shipping internationally?&nbsp;</b></div><div><br></div><div>We are proud to pursue a very stringent customer-centered approach, and we also ensure that consumers benefit from our goods and services provided worldwide.&nbsp;</div><div><br></div><div>We move globally, but regretfully remind you that in your home country, we do not pay tariffs and taxes, and ask you to pay domestic shipping charges.&nbsp;</div><div><br></div><div><b>Do we ship to addresses that are APO or FPO?&nbsp;</b></div><div><br></div><div>You should be assured that we send to APO addresses and FPO addresses. Orders sent to APO and FPO addresses, however, can only be sent by the US postal service, with little discretion about the timing of delivery.</div><div><br></div><div><b>If so, how do I contact FedEx?&nbsp;</b></div><div><br></div><div>FedEx can be reached on the official website:<a href=\"https://www.fedex.com/\" title=\"Fedex\" target=\"_blank\"> www.FedEx.com</a>, or by calling their toll-free number at 1-800-463-33399. (1-800-GO-FEDEX).</div><div><br></div><div><b>Can JBS Devices account for the risk of returning products that are faulty or destroyed upon delivery for shipping?&nbsp;</b></div><div><br></div><div>It is with sadness to state that we will not pay delivery charges for returned goods that are faulty, but with mutually agreed negotiations, we will satisfy you. If you agree to pay for the refund charges for the faulty piece, we will happily repair and send a new item to you free of charge.&nbsp;</div><div><br></div><div><font size=\"5\">Standard Free Delivery&nbsp;</font></div><div><br></div><div>If a non-defective item eligible for free regular shipping is returned for a refund, we will subtract the shipping costs from the refund number.&nbsp;</div><div><br></div><div>If you return a free regular shipping item because it is faulty, we will repair the item and provide you with a free one-way ground shipping service.&nbsp;</div><div><br></div><div>However, if the order does not wait longer, you will have to pay for the extra cost.&nbsp;</div><div>In the event of failure to locate a substitute for an object, please be assured that we will refund the full value of your orders.&nbsp;</div><div><br></div><div><font size=\"5\">Shipping Services&nbsp;</font></div><div><br></div><div>JBS Devices makes use of the delivery systems of UPS, FedEx, and USPS in all regions of the US to transport goods directly from its warehouses. Our primary distribution partners are all the transportation providers listed. Many orders are delivered by JBS Devices within 24 hours of order placing.&nbsp;</div><div><br></div><div><b>Our list of shipping services with their corresponding cut-off times is listed below:&nbsp;</b></div><div><br></div><div><b>Ground</b>: The transit time in the US ONLY is from 3-7 business days, the cut-off time is 1 pm Central Time. Ground orders can be delivered either by UPS or USPS, depending on the venue.&nbsp;</div><div><br></div><div><b>UPS 3 Day</b>: UPS orders are in transit for 3 business days, but ONLY in the US.&nbsp;</div><div><br></div><div><b>UPS 3 Days\' time cut-off1pm FedEx 2 Day</b>: For orders made ONLY in the US, FedEx takes 2 business days in transit and the cut-off time is 1 PM Central Time.&nbsp;</div><div><br></div><div><b>Standard Overnight</b>: For orders made ONLY in the US, the standard delivery service takes around 1 business day in transit. 1 PM Central Time is the cut-off time. We can deliver the order via UPS Red Saver or FedEx Normal Overnight service, depending on the venue.&nbsp;</div><div><br></div><div><b>Priority Overnight</b>: 1 business day transfer time for orders placed in the US ONLY, with a 1 PM Central Time cut-off time. We will offer UPS Red or FedEx P1 Overnight service, depending on the venue, guaranteeing delivery by 10:30 AM on the same day. International Shipping: 1 PM Central Time is the cut-off time for all international orders.&nbsp;</div><div><br></div><div>Using the FedEx International Economy process, we ship international orders.&nbsp;</div><div><br></div><div><b>APO/FPO</b>: JBS Devices uses USPS Registered Mail to ship all APO/FPO orders.&nbsp;</div><div><br></div><div><b>Puerto Rico/Canada</b>: All orders delivered to Puerto Rico/Canada are shipped by the delivery system of FedEx\'s International Economy, although their cut-off time is 1 PM Central Time.&nbsp;</div><div><br></div><div><b>Saturday Shipping</b>: It operates in all US states and on all orders made on Friday. The cut-off is midnight Central Time and orders can be delivered by the Saturday Delivery system of UPS or FedEx.&nbsp;</div><div><br></div><div><b><font size=\"4\">What is the cut-off time?</font></b></div><div><br></div><div>Cut-off time mentions the time after order placing your order will be processed. If your order is received before 1 PM Central Time, it will be handled on the same day, although it will be processed on the next business day if your order is placed after 1 PM Central Time. if you want your order to be delivered before or after the above cut-off dates, please contact our Sales Department and we will look into your case.&nbsp;</div><div><br></div><div><font size=\"4\">Delays in Shipment&nbsp;</font></div><div><br></div><div>On weekends and holidays, our delivery system does not process any requests. Because each order goes to processing time, if possible, we ask you to be careful. We want you to note that assured delivery facilities, not counting the time it takes to process the shipment, are only guaranteed for the transit time. It is humanly difficult to ensure that all orders will be delivered on the same day, while most orders are shipped on the same day. For orders made from Hawaii, Alaska, Puerto Rico, Canada, and other foreign locations with JBS Devices, we cannot guarantee fixed shipping dates.&nbsp;</div><div><br></div><div><font size=\"4\">If an ordered object is missing from my box, what do I do?&nbsp;</font></div><div><br></div><div>Please make sure that you can all the shipments for which you have obtained the tracking numbers. If you do not locate the goods, please email our customer service or our Shipping Support Team at <a href=\"mailto: support@jbsdevices.com\" title=\"Mail\" target=\"\">support@JBSDevices.com</a> or call us at&nbsp;<a href=\"tel:+1 469-459-9688\" style=\"color: rgb(44, 45, 51); background-color: rgb(249, 249, 249); font-family: Rubik, &quot;Source Sans Pro&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 15.008px; letter-spacing: -0.22512px;\">+1 469-459-9688</a>.&nbsp;</div><div><br></div>', NULL, NULL, 0, 1),
(9, 'Terms and Conditions', 'terms-and-conditions', '<div><font size=\"5\">Conditions and Terms of Use&nbsp;</font></div><div><br></div><div>The following are the guidelines relating to the proper use of the JBSDevices.com website, the goods, and services provided by us are not limited to, our product directory, lists, but also include external links to every other website.&nbsp;</div><div><br></div><div>You agree to abide by the above Terms and Conditions of Use of the Site (TCUS) while accessing our website, including, but not limited to, our privacy policy, other instructions that we may check and amend over time, collected and written for your reference herein, and you also agree to follow our relevant JBS Devices rules and regulations. The JBS Devices (the \"Company\") reserves the right, if necessary, to adjust its TCUS every so often. To read about the latest improvements and improvements made on the website, users are responsible for reviewing our account from time to time. Your existence and use of the website would be viewed as approval of some improvement following the improvements in JBS Devices TCUS (s). Users under the age of 13 years of age are explicitly barred from accessing our website and from publishing personal and identifying material.&nbsp;</div><div><br></div><div>The aim of our website is not to be used by people aged 13 or under. The JBS Devices (the \"Company\") reserves the right, if necessary, to adjust its TCUS every so often. To read about the latest improvements made on the website, users are responsible for reviewing our account from time to time. Your existence and use of the website would be viewed as approval of some improvement following the improvements in JBS Devices TCUS (s).&nbsp;</div><div><br></div><div>Users under the age of 13 years of age are explicitly barred from accessing our website and from publishing personal and identifying material. The aim of our website is not to be used by people aged 13 or under.&nbsp;</div><div><br></div><div><font size=\"5\">Authorization and Usage Privileges&nbsp;</font></div><div><br></div><div>JBS Devices (the \"Company\") offers users an inclusive right and permission to view and use the website for any real, commercial or non-commercial purchase of products for use or resale, including but not limited to.&nbsp;</div><div><br></div><div>Our access privileges and permissions, however, specifically, preclude the following actions:&nbsp;</div><div><br></div><div><ul><li>The resale of the website or its related material&nbsp;</li><li>Prohibits the compilation and use, unless expressly approved, of its product lists, names, specifications, and prices&nbsp;</li><li>Plagiarized, replicated use of our site or its related material&nbsp;</li><li>Restricts data processing, robotics, data analysis, and extraction methods.&nbsp;</li><li>JBS Devices (the \"Company\") is protected by US copyright law and international law and convention, including but not limited to, its activities and procedures, interface, content.&nbsp;</li><li>Except allowed, it shall not be copied, reproduced, imitated, sold, manipulated, maliciously visited, or resold in any manner for any unlawful and unacceptable purpose.&nbsp;</li><li>Any malicious and unauthorized use of the website shall automatically result in the revocation of the license and the privileges permitted by the company and may subject you to legal action and investigation.&nbsp;</li><li>You can make hyperlinks anywhere on the website limited, revocable, and inclusive, as long as the connection created restricts the display of the Website, the&nbsp;</li><li>The organization, its affiliates, investors, co-brand accomplices, licensors, and any other partners, its goods and services, in a manner that is deceiving, harsh, or in any way invasive or damaging.&nbsp;</li><li>Unless otherwise approved in writing by the Firm, its subsidiary, associate, co-brand partner, or other partner or licensor, you shall not use any licensor, associate, subsidiary, co-brand partner, partner logo, or registered graphic or trademark associated with JBS Devices as part of a link to the website.&nbsp;</li><li>You are permitted to make hyperlinks to any page of the website limited, revocable, and inclusive, as long as the connection created restricts the display of the website, the&nbsp;</li><li>The organization, its associates, investors, co-brand accomplices, licensors, and any other partners, its goods and services in a manner that is deceiving, harsh, or in any way invasive or damaging.&nbsp;</li><li>Unless otherwise approved in writing by the Firm, its subsidiary, associate, co-brand partner, or other partner or licensor, you shall not use any licensor, associate, subsidiary, co-brand partner, partner logo, or registered graphic or trademark associated with JBS Devices as part of a link to the website.&nbsp;</li><li>You are permitted to make hyperlinks to any page of the website limited, revocable, and inclusive, as long as the connection created restricts the display of the website, the&nbsp;</li><li>The organization, its associates, investors, co-brand accomplices, licensors, and any other partners, its goods and services, in a manner that is deceiving, harsh, or in any way invasive or damaging.&nbsp;</li></ul></div><div><br></div><div><font size=\"5\">Contents and Stock Listings&nbsp;</font></div><div><br></div><div>JBS Devices strives and works to provide comprehensive details about all of the items offered; the specifications, names, photographs shown, costs, links, references to compatibility, and other related information on the website.&nbsp;</div><div><br></div><div>However, as regards human potential, it cannot promise or warrant that, irrespective of its source, the material and relevant material contributed to on the website would be fully correct, credible, modified, or error-free.&nbsp;</div><div><br></div><div>The material provided on the website by JBS Devices is for information purposes only and does not produce any sponsorship of any product, service, reseller, manufacturer, or other related entities offered.&nbsp;</div><div><br></div><div>In case of any typographical, technological, or other miscalculation, a product or service sold by a company has incorrect details or erroneous pricing, the company shall, with its sole caution, reserve the right to deny or refuse orders made for the product or service in question and thus immediately check and change the product or service records.&nbsp;</div><div><br></div><div><font size=\"5\">Links to Sites and Businesses&nbsp;</font></div><div><br></div><div>Our website provides links (hyperlinks) to websites of other vendors, details blog pages of third parties, analysis sites, related firms, and affiliate sites, and other outlets to help users with their buying choices. Each connection provided by the Organization is for information purposes only and the assistance of customers. The Corporation does not equate these ties in any manner with any recognition of the content of the third-party pages or their market practices.&nbsp;</div><div><br></div><div><font size=\"5\">Order Acknowledgement&nbsp;</font></div><div><br></div><div>If you buy a product from the JBS Devices product page, you get a website order acknowledgment that makes and accepts your order. However, it is not a contract and does not produce approval of the order, and acts merely as a record of the order, describing the purchase and its pricing. JBS Devices will decide whether or not to satisfy your order after you put an order. For any because which may not be disclosed, JBS Devices retain the right to cancel or restrict your order.</div><div><br></div><div>JBS Devices does not recognize any duties or liabilities for the assessment of such material or other enterprises. Reading and reviewing their TCUS and privacy policy policies are your responsibility.&nbsp;</div><div><br></div><div>JBS Devices does not have any influence or jurisdiction over the entities affiliated with its website or any of its corporate processes and procedures. In no way does the Company monitor or take responsibility for the quality, legality, and protection of the goods and services provided on the hyperlinked website or company, nor does the Company take responsibility for or control business transactions carried out on the linked companies or websites.&nbsp;</div><div><br></div><div><font size=\"5\">Delivery Disputes</font></div><div><br></div><div>In the event of any dispute or wrongdoing between a customer and any company site redirected to JBS Devices.com to the maximum degree allowed by the relevant statute, the user shall keep JBS Devices innocent and discharge its founders, branches, partners or any other affiliated group, its respective officials, administrators, staff, agents or legal representatives, arising out of any or any of the roles and statements or damages arising out of or in some manner connected with some such wrongdoing or dispute, whether identified or unknown, alleged or unsuspected. In the order placing process, clients often reserve the right to convey their delivery orders to the carrier service.&nbsp;</div><div><br></div><div>However, JBS Devices will select a shipping method that better suits the distribution of the customer\'s ordered product where there are no directions given by the customer.&nbsp;</div><div><br></div><div>In no circumstances will the Company be responsible for any delay or harm sustained during the shipping process of the freight.&nbsp;</div><div><br></div><div>Also, if the shipping is postponed due to the customer, the Company shall, in all cases, store the goods purchased at the customer\'s cost and cost.&nbsp;</div><div><br></div><div><font size=\"5\">Damage during shipping</font></div><div><br></div><div>Chance of any injury or failure to the product in the case of the FOB shipping process, any harm, loss, or damage to the product will be carried on to the consumer, his agent, or the freight/carrier service solely.&nbsp;</div><div><br></div><div><font size=\"5\">Order cancellation</font></div><div><br></div><div>Order Termination Orders accepted by JBS Devices will NOT be subject to a customer\'s modification or revocation without the express approval of JBS Devices or its approved members. Every order canceled, substituted, or updated would have a nominal processing charge of $25 or 15 percent of the order value. If you wish to cancel or change your order, you will contact our customer service.</div><div><br></div><div>There will be no order termination emails approved. In the event of a product\'s unavailability or backorder status, JBS Devices can reject or cancel, at its own will, an order. We apologize to you for any inconvenience of that kind.&nbsp;</div><div><br></div><div>You are expected to become conscious, verify, or acknowledge that any of the things in our listings may not be in stock. Therefore, please check the stock specifics before making an order.&nbsp;</div><div><br></div><div>If the company no longer offers/stocks a good that it has received for substitution from a client, or if the service is out of stock on occasion, it may be referred to the Department of RMA. The consumer would have two alternatives in such a situation: JBS Devices will give you a similar repair or replacement piece. JBS Devices issues a rebate that evaluates the actual market value of the commodity purchased. In every such scenario, the present price of the retail product does not surpass the initial invoiced price of the good.&nbsp;</div><div><br></div><div><font size=\"5\">Jurisdiction authority&nbsp;</font></div><div><br></div><div>In the event of any judicial proceeding to deduce or enforce the terms of this Arrangement being taken, the jurisdiction and location shall be within the Local or Superior courts of the State of Circuit Court of the United States, or elsewhere, according to the joint agreement of the parties involved.&nbsp;</div><div><br></div><div><font size=\"5\">Control &amp; Central Law&nbsp;</font></div><div><br></div><div>Any questions respecting the form and development of this Arrangement, the rights and obligations of the parties, as provided for in the terms of the documents, shall be decided and determined only in compliance with the relevant legislation of the State of the United States of America.&nbsp;</div><div><br></div><div><font size=\"5\">Prosecutor\'s Cost&nbsp;</font></div><div><br></div><div>Where any civil act, mediation, prosecutions are carried out in compliance with the clarifications or enforcements of this Arrangement, or in respect to the interests of a Defendant, due to any perceived violation of the Agreement, wrongdoing or disagreement, effective misconduct, or the principal Party, fair attorney\'s fees or other associated costs shall be recovered.</div><div><br></div><div><font size=\"5\">Dropship Requests for Product by Customers</font></div><div><br></div><div>If a customer asks our company to sell or send their goods to a third party, the customer and the third party\'s final user would both have to be bound by the terms and conditions of this arrangement.&nbsp;</div><div><br></div><div><font size=\"5\">Conflicting words</font></div><div><br></div><div>Any terms and conditions related to and/or presented in the orders of the consumer that may interfere with JBS Devices TCUS would not be available without JBS Devices\' written approval. Both instructions approved by JBS Devices shall, however, be subject to TCUS.&nbsp;</div><div><br></div><div><font size=\"5\">Purchase Money Security Interest</font></div><div><br></div><div>If the customer effectively completes, executes, and approves an order, the customer gives JBS Devices the right to \'continued buying money protection interest\' as security on all due or timely payments in all payable sums under any purchased order from the customer.&nbsp;</div><div><br></div><div>It hereby grants access to all merchandise or other proceeds of which the consumer has any right, title, or interest. Upon its timely request, customers shall enter JBS Devices to complete financial statements, any changes, or continuity statements and pay the same filing costs at any time when JBS Devices estimates are required; customers shall complete and send to JBS Devices all records, equipment and do as JBS Devices may request to fully enforce this Protection Inter Drives&nbsp;</div><div><br></div><div>If under the protection arrangement given, the customer/buyer is in default, JBS Devices retains the right to seek relief available under the statute.&nbsp;</div><div><br></div><div><font size=\"5\">Cash Back guarantee&nbsp;</font></div><div><br></div><div>Please read our return policy carefully, so you can swap or return the product ordered from JBS Devices in case of any inconvenience.&nbsp;</div><div><br></div><div><font size=\"5\">Professional Assistance from Free CCIE:&nbsp;</font></div><div><br></div><div>We also set up a free Cisco Specialist Consulting Program for professional learning and technological assistance for customers. By phone, email, or the live chat option, you can contact us.&nbsp;</div><div><br></div><div><font size=\"5\">Payment &amp; Shipping Secure:&nbsp;</font></div><div><br></div><div>Our customers trust us and, above all, we respect this trust. Our suppliers ship our goods on schedule and with proper protection, ensuring that a safe payment system is in operation. Our checked authorization includes VeriSign Safe, MacAfee Security.&nbsp;</div><div><br></div><div><font size=\"5\">Copyrights&nbsp;</font></div><div><br></div><div>JBS Devices does not reflect, in any way, known or unknown, any intellectual property rights that it may or may not have on the catalog of goods on its websites.&nbsp;</div><div><br></div><div><font size=\"5\">100 percent Price Match Guarantee: Warranty Info&nbsp;</font></div><div><br></div><div>At JBS Devices, we aim to provide you with the lowest available commodity costs and provide a 100% guarantee that our prices will never reach the price of the rival.&nbsp;</div><div><br></div><div><font size=\"5\">Free Technical Support&nbsp;</font></div><div><br></div><div>We provide free training to our clients by hiring cisco expert. You can get the training by contacting our customer service helpline.&nbsp;</div><div><br></div><div><font size=\"5\">100% Quality Assurance:&nbsp;</font></div><div><br></div><div>We emphasize product quality for improved consumer service, and thus, before each shipping, a full check and balance is carried out for all goods. We still make sure that all of our products are 100% authentic and original.&nbsp;</div><div><br></div><div><font size=\"5\">Secure shipment and payment&nbsp;</font></div><div><br></div><div>Our clients trust us and at JBS Devices we value this trust above all. Our manufacturers ship the products on time and with complete safety, ensuring there is a secure payment method in place. Our verified authorization are: VeriSign Secured, MacAfee Security.</div><div><br></div><div><font size=\"5\">Return Material Authorization (RMA) Process:&nbsp;</font></div><div><br></div><div>In the case of any returns, after agreeing on the terms and conditions are given, an RMA request should be raised:&nbsp;</div><div><br></div><div><ol><li>Regardless of the justification for return, it is obligatory on all returns of JBS Devices objects.&nbsp;</li><li>Products with all the accessories, manuals, applications, and warranty statements should be returned. The original packaging does not result in any harm.&nbsp;</li><li>You will have to repack items exactly as they have been shipped to you upon getting your RMA number, maybe in the original outer box/package. If the original packaging is destroyed, a re-stocking fee of 25 percent may be paid.&nbsp;</li><li>Do not write explicitly on the initial box to prevent return rejection.&nbsp;</li><li>Mention the address of JBS Devices on the outer box correctly and simply by using a sticker.&nbsp;</li><li>When our supply chain department has acquired and checked the shipment, you can collect the exchanged package within 10 days of delivery of the defective item.&nbsp;</li><li>Please notice that we must be told within two days of the arrival of the items in case of any inconsistencies between your PO and the products purchased.&nbsp;</li></ol></div><div><br></div><div><font size=\"5\">Faulty products under warranty&nbsp;</font></div><div><br></div><div>Immediately after you encounter a defect in your purchased piece, please submit an RMA order. The terms and conditions to be agreed upon before the RMA submission are as follows:&nbsp;</div><div><br></div><div><ul><li>Quote the damaged item\'s order number, purchase date, and serial number.&nbsp;</li><li>After verifying the warranty of the damaged device, one of our engineers will attempt to fix your issue over the phone or through remote access.&nbsp;</li><li>An RMA number will be given if the problem continues, and you will need to follow our regular RMA protocol.</li><li>We will test it and correct the issue after the object has been returned. When the object will not be restored, we can send a replacement.&nbsp;</li><li>Hardware that has been replaced can be new or similar to new and have equal or equivalent requirements.</li></ul></div><div><br></div>', NULL, NULL, 0, 1);
INSERT INTO `pages` (`id`, `title`, `slug`, `details`, `meta_tag`, `meta_description`, `header`, `footer`) VALUES
(10, 'Managed Services', 'managed-services', '<div><font size=\"5\">Our Partners</font></div><div>&nbsp;</div><div style=\"text-align: center;\"><img src=\"https://www.jbsdevices.com/assets/images/logos.png\" alt=\"Partners\" align=\"none\" style=\"margin:auto;\"><br></div><div style=\"text-align: center;\"><font size=\"5\">Our Services</font></div><div style=\"text-align: center;\"><br></div><div>JBS delivers<b> technological solutions</b> from ideation to execution, enabling clients to outperform the competition. By utilizing the most advanced tools and practices, we offer <b>consultation, implementation, training</b>, and <b>licensing </b>to our customers with utmost excellence.&nbsp;</div><div><br></div><div>JBS has the most extensive countrywide support infrastructure, and its customers can enjoy services like <b>mission critical support, 24/7 support</b>, <b>warranty support</b>,<b> help desk services</b>, <b>resident engineer services</b>, <b>hardware &amp; software deployment services</b>, &amp; <b>complete IT outsource</b> to name a few. These, along with well managed inventory and competent human capital, enable JBS to extend the most comprehensive and responsive services to its customers to meet their mission critical business goals.</div><div><br></div><div><ul><li><b>Consultancy </b>- Our technical team helps you reduce costs and save time through expert advisory. We assist you in understanding your business.</li><li><b>Implementation </b>- Our experts deliver implementation services of a variety of virtualized solutions with best practices and a track record of success.</li><li><b>Service Level Agreement</b> - Service Level Agreements (SLAs) define how we respond to your issues and requests. They reflect our reliability, efficiency, and confidence in the support that we provide. A Service Level Agreement (SLA) with us assures you quality implementation and continued system availability. With our enterprise technical support, you have access to the support professionals and services that best suit your infrastructure and project needs.</li><li><b>Professional &amp; Managed Services</b> - An always-available managed services solution that gives customers the ability to rapidly report and solve any IT issues.</li><li><b>Multivendor Solutions</b> – From security to the service desk, from data center management to the cloud, JBS tailors your ideal package of services to meet key goals.</li><li><b>Remote Support</b> – Our team provides end-to-end support and guidance for you; whenever, however, and wherever you need it.</li><li><b>Certifications and Trainings</b> - Our Solutions Specialists and Microsoft Certified Trainers deliver trainings on Microsoft technologies including Modern Workplace, Azure solutions, and Power Platform, equipping you to drive productivity in your workplace.</li></ul></div><div><br></div><div><br></div><div><br></div><div><br></div>', NULL, NULL, 0, 1),
(11, 'Careers', 'careers', '<br>', NULL, NULL, 0, 1);
