le 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><div><div><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>How can I track my order?<br><br></b>You will receive an email from JBS Devices including the tracking number and link after we hand over your package to FedEx.<b><br></b></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>How can I calculate shipping to my destination?</b></p>Every product has a shipping calculator under \r\nthe shipping tab, you can calculate shipping cost and duration according to your destination, \r\nproduct weight, height, and length.<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>FedEx tracking number is not running, what\'s the\r\nproblem? </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">One of your items may have been removed from the box by\r\nFedEx or they may not have delivered all of your items. In such a scenario,\r\nyou might be asked to wait a bit longer for the things you ordered to be\r\nshipped. However, if your order is unfortunately not received, you can contact\r\nour customer service or our shipping department for an update on your package.\r\nIf you get a faulty shipment, you may call the carrier directly. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>What do I do if I am unable to receive my order\r\nwithin the period selected by UPS/FedEx? </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">We recommend that you review the UPS/FedEx Details.\r\nMessage and learn whether a delivery re-attempt is allowed. On the Details\r\nNote, you will even leave a message for the courier to tell him how the\r\ndelivery can be delivered; leave it at your door or send it to a new venue. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">We recommend that you visit the UPS/FedEx page and type\r\nyour Details Request number on the website so that you can change the time of\r\ndelivery or return your order to the shipper. Is my order possible for me to\r\npick it up? </p></div></div><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>JBS Devices provides you with the ease of picking up\r\nyour order. </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">To do this, simply pick the shipping form \"I want\r\nto use my shipper\" in your shopping cart and enter \"will call\"\r\nin all the blank information before pressing update. Once you do this, as you\r\nusually will, resume the checkout process and wait for us to contact you.\r\nWhenever your order is ready to be picked up, we will call. Please be aware\r\nthat we will contact you after approving your order, so we recommend that you\r\nnot visit the office until you have been informed. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>Are we shipping internationally? </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">We are proud to pursue a very stringent\r\ncustomer-centered approach and we also ensure that consumers benefit from our\r\ngoods and services provided worldwide. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">We move globally, but regretfully remind you that in\r\nyour home country, we do not pay tariffs and taxes and ask you to pay domestic\r\nshipping charges. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>Do we ship to addresses that are APO or FPO? </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">You should be assured that we send to APO addresses and\r\nFPO addresses. Orders sent to APO and FPO addresses, however, can only be sent\r\nby the US postal service, with little discretion about the timing of delivery.</p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>If so, how do I contact FedEx? </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">FedEx can be reached on the official website: <a href=\"http://www.FedEx.com\" title=\"www.FedEx.com\" target=\"\"><u style=\"text-underline:#0000EE\"><span style=\"color:#0000EE\">www.FedEx.com</span></u></a>,\r\nor by calling their toll-free number at 1-800-463-33399. (1-800-GO-FEDEX).</p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>Can JBS Devices account for the risk of returning\r\nproducts that are faulty or destroyed upon delivery for shipping? </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">It is with sadness to state that we will not pay\r\ndelivery charges for returned goods that are faulty, but with mutually agreed\r\nnegotiations, we will satisfy you. If you agree to pay for the refund charges\r\nfor the faulty piece, we will happily repair and send a new item to you free of\r\ncharge. </p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>Standard Free Delivery </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">If a non-defective item is eligible for free regular\r\nshipping is returned for a refund, we will subtract the shipping costs from the\r\nrefund number. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">If you return a free regular shipping item because it\r\nis faulty, we will repair the item and provide you with a free one-way ground\r\nshipping service. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">However, if the order does not wait longer, you will\r\nhave to pay for the extra cost. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">In the event of failure to locate a substitute for an\r\nobject, please be assured that we will refund the full value of your orders. <br></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>Shipping Services </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">JBS Devices makes use of the delivery systems of UPS,\r\nFedEx, and USPS in all regions of the US to transport goods directly from its\r\nwarehouses. Our primary distribution partners are all the transportation\r\nproviders listed. Many orders are delivered by JBS Devices within 24 hours of\r\norder placing. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>Our list of shipping services with their\r\ncorresponding cut-off times is listed below: </b></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><table border=\"1\"><tbody><tr style=\"height: 54px;\"><td style=\"width: 15.1123%; height: 54px; text-align: center;\"><strong>Ground</strong></td><td style=\"width: 84.8877%; height: 54px; text-align: left;\">In the US \r\nONLY, the transit time is between 3-7 business days, cut-off time stands at 1 PM Central Time. Depending on your location, Ground orders maybe \r\ndelivered by either UPS or USPS.</td></tr><tr style=\"height: 36px;\">\r\n<td style=\"width: 15.1123%; height: 36px; text-align: center;\"><strong>UPS 3 Day</strong></td>\r\n<td style=\"width: 84.8877%; height: 36px;\">UPS orders take 3 business days in transit, however ONLY in the US. UPS 3 Day’s cut-off time is 1 PM Central Time.</td>\r\n</tr><tr style=\"height: 36px;\">\r\n<td style=\"width: 15.1123%; height: 36px; text-align: center;\"><strong>FedEx 2 Day</strong></td>\r\n<td style=\"width: 84.8877%; height: 36px;\">FedEx takes 2 business days in transit for orders placed ONLY in the US, and the cut-off time is 1 PM Central Time.</td>\r\n</tr><tr style=\"height: 18px;\">\r\n<td style=\"width: 15.1123%; height: 18px; text-align: center;\"><strong>Standard Overnight</strong></td>\r\n<td style=\"width: 84.8877%; height: 18px;\">Standard delivery service takes about 1 business day in transit for orders placed ONLY in the US. \r\nCut-off time is 1 PM Central Time. Depending on the location, we may deliver the order by UPS Red Saver or FedEx Standard Overnight service.</td>\r\n</tr><tr style=\"height: 18px;\">\r\n<td style=\"width: 15.1123%; height: 18px; text-align: center;\"><strong>Priority Overnight</strong></td>\r\n<td style=\"width: 84.8877%; height: 18px;\">1 business day transit time \r\nfor orders placed in the US ONLY, with the cut-off time at 1 PM Central \r\nTime. Depending on the location, we may deliver by UPS Red or FedEx P1 \r\nOvernight service, guaranteeing the delivery by 10:30 AM on the same day.</td>\r\n</tr><tr style=\"height: 18px;\">\r\n<td style=\"width: 15.1123%; height: 18px; text-align: center;\"><strong>International Shipping</strong></td>\r\n<td style=\"width: 84.8877%; height: 18px;\">The cut-off time for all international orders is 1 PM Central Time. We ship international orders \r\nusing FedEx International Economy method.</td>\r\n</tr><tr style=\"height: 18px;\">\r\n<td style=\"width: 15.1123%; height: 18px; text-align: center;\"><strong>APO/FPO</strong></td>\r\n<td style=\"width: 84.8877%; height: 18px;\">JBS Drives ships all APO/FPO orders using USPS Registered Mail.</td>\r\n</tr><tr style=\"height: 18px;\">\r\n<td style=\"width: 15.1123%; height: 18px; text-align: center;\"><strong>Puerto Rico/Canada</strong></td>\r\n<td style=\"width: 84.8877%; height: 18px;\">All orders delivered to \r\nPuerto Rico/Canada are shipped by the delivery system of FedEx\'s \r\nInternational Economy, although their cut-off time is 1 PM Central Time</td>\r\n</tr><tr style=\"height: 18px;\">\r\n<td style=\"width: 15.1123%; height: 18px; text-align: center;\"><b>Saturday Shipping</b></td>\r\n<td style=\"width: 84.8877%; height: 18px;\">JBS Drives ships all APO/FPO orders using USPS Registered Mail.</td>\r\n</tr><tr style=\"height: 18px;\"><td style=\"width: 15.1123%; height: 18px; text-align: center;\"><strong>Countries we ship to</strong></td><td style=\"width: 84.8877%; height: 18px;\">USA, Canada, Australia, New Zealand United Kingdom, Ireland, Germany, France, Sweden, UAE, Oman, Singapore, and China</td></tr></tbody></table>\r\n\r\n<div><br></div><div><b>Shipping Charges:</b></div><div><br></div><div>\r\nShipping costs vary depending on a variety of factors, from shipment type, weight, and location. Once these variables are calculated during \r\ncheckout, a carrier will put a price on your shipment.</div><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>What is the cut-off time?</b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">Cut-off time mentions the time after order placing your\r\norder will be processed. If your order is received before 1 PM Central Time, it\r\nwill be handled on the same day, although it will be processed on the next\r\nbusiness day if your order is placed after 1 PM Central Time. if you want your\r\norder to be delivered before or after the above cut-off dates, please contact\r\nour Sales Department and we will look into your case. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>Delays in Shipment </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">On weekends and holidays, our delivery system does not\r\nprocess any requests. Because each order goes to processing time, if possible,\r\nwe ask you to be careful. We want you to note that assured delivery facilities,\r\nnot counting the time it takes to process the shipment, are only guaranteed for\r\nthe transit time. It is humanly difficult to ensure that all orders will be\r\ndelivered on the same day, while most orders are shipped on the same day. For\r\norders made from Hawaii, Alaska, Puerto Rico, Canada, and other foreign\r\nlocations with JBS Devices, we cannot guarantee fixed shipping dates. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\"><b>If an ordered object is missing from my box, what do\r\nI do? <br></b></p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:\r\n12.0pt;margin-left:0cm\">Please make sure that you can track the shipments for\r\nwhich you have obtained the tracking numbers. If you do not locate the goods,\r\nplease email our customer service or our Shipping Support Team at\r\n<b><a href=\"mailto:shipping@jbsdevices.com\" title=\"shipping@jbsdevices.com\" target=\"\">shipping@jbsdevices.com</a></b> or call us at <b><a href=\"tel:+1 469-459-9688\">+1 469-459-9688</a></b>.</p>', NULL, NULL, 0, 1);
